import React from "react";
import "./OurProject.css";

function OurProject() {
  return (
    <div>
      <div className="sec2-heading">Our Projects</div>
      <div className=" sec2-heading2">
        We did projects for many startups and brands
      </div>
      <div className="sec2-content">
        <div className="sec2-sub-heading">The Challenge for us</div>
        <div className="sec2-sub-para">
          With a pan India field footprint and a whole new t<br />
          hinking on delivering measurable value to our <br />
          clients, we try to unearth every conceivable store <br />
          related issue that affects execution and sales of
          <br />
          our clients.
        </div>
        <div className="sec2-sub-heading">Client</div>
        <span>Retail Scan</span>
      </div>
    </div>
  );
}

export default OurProject;
